import './navbar.component.css';
import { ReactComponent as Cat } from './cat.svg'

function Navbar() {
  const navbarName = 'I am the navbar';
  return (    
    <div class="navbar">
      <p>{navbarName}</p>
      <div class="nav-img">
      <Cat/>
      </div>
    </div>
  );
}

export default Navbar;
